%[text] %[text:anchor:T_6F9FE18E] # **Line Selector Chart Examples**
%[text] **Overview**
%[text] The `LineSelectorChart` manages multiple line plots, for which the *y*-data is on possibly different scales.The chart data comprises a numeric vector (`XData`) together with a numeric data matrix (`YData`). Each column of the `YData` is plotted against the `XData`, using a normalized scale so that all lines are visible together. Clicking on a line highlights it and shows its *y*-data on the true scale via *y*-axis limits and ticks. Clicking on another line changes the selection. Lines can be selected by clicking on the line itself, or programmatically by calling the `select` method of the chart.
%[text] ![LineSelectorChart.png](text:image:62b8)
%[text] **Documentation**
%[text] - [`line`](<matlab: doc("line")>): Create primitive line \
%[text] See also:
%[text] - [`stackedplot`](<matlab: doc("stackedplot")>): Stacked plot of several variables with a common x-axis \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_611FC1A8] ## Load and prepare the exchange rate data.
%[text] The data comprises a timetable of exchange rates (local currency per $US) for eight currencies.
load( fullfile( chartsRoot(), "data", "Exchange.mat" ), "T" )
%[text] Create a numeric time vector, in fractional years, for use with the chart.
startDate = min( T.Date );
yearStart = dateshift( startDate, "start", "year" );
yearEnd = dateshift( startDate, "end", "year" );
fracYear = days( startDate - yearStart ) / days( yearEnd - yearStart );
t = startDate.Year + fracYear + years( T.Date - startDate );
%[text] Extract the currency codes.
codes = T.Properties.VariableNames;
%%
%[text] %[text:anchor:H_99C6F0B5] ## Create a figure for the chart.
f = exampleFigure( "Name", "LineSelectorChart Example" ); %[output:1765a29c]
%%
%[text] %[text:anchor:H_28A9B100] ## Create the chart, specifying the data, figure and legend entries.
LSC = LineSelectorChart( "Parent", f, ... %[output:group:9cdc49ae] %[output:1765a29c]
    "XData", t, ... %[output:1765a29c]
    "YData", T.Variables ); %[output:group:9cdc49ae] %[output:1765a29c]
%%
%[text] %[text:anchor:H_0CA8C9D9] ## Annotate the chart and customize its appearance.
xlabel( LSC, "Year", "FontSize", 14 ) %[output:6ba15714]
ylabel( LSC, "Exchange Rate (Local/$US)", "FontSize", 14 ) %[output:6ba15714]
title( LSC, "Line Selector Chart", "FontSize", 16 ) %[output:6ba15714]
xlim( LSC, [1979, 2000] ) %[output:6ba15714]
legend( LSC, codes, "Location", "southoutside", ... %[output:group:9611d638] %[output:6ba15714]
    "Orientation", "horizontal" ) %[output:group:9611d638] %[output:6ba15714]
%%
%[text] %[text:anchor:H_3F953801] ## Change the chart data to show a particular decade.
LSC.YData = LSC.YData(LSC.XData >= 1980 & LSC.XData < 1990, :); %[output:5cfad18f]
xlim( LSC, [1979.5, 1990.5] ) %[output:5cfad18f]
%%
%[text] %[text:anchor:H_A39F8CA2] ## Show Australian and Canadian dollar exchange rates only.
AUDCAD = ["AUD", "CAD"];
LSC.YData = LSC.YData(:, ismember( codes, AUDCAD )); %[output:7ffffeec]
legend( LSC, AUDCAD, "Location", "northwest", ... %[output:group:7df5093b] %[output:7ffffeec]
    "Orientation", "vertical" ) %[output:group:7df5093b] %[output:7ffffeec]
%%
%[text] %[text:anchor:H_FB145180] ## Select a currency to highlight.
select( LSC, 1 ) %[output:8ca0b2d6]
%%
%[text] %[text:anchor:H_76B3FFE3] ## Change the selection and highlight color.
select( LSC, 2 ) %[output:2012155c]
LSC.SelectedColor = [1, 0.5, 0]; %[output:2012155c]
%%
%[text] %[text:anchor:H_437D8A01] ## Include more lines in the chart, update the legend text and set the x-axis limits automatically.
set( LSC, "XData", t, "YData", T.Variables ) %[output:85ac70c9]
drawnow()
legend( LSC, codes, "Location", "eastoutside" ) %[output:85ac70c9]
xlim( LSC, [-Inf, Inf] ) %[output:85ac70c9]
%%
%[text] %[text:anchor:H_512BF86C] ## Select a currency and change the color of the unselected lines.
select( LSC, 3 ) %[output:9f29a704]
LSC.TraceColor = 0.95 * ones( 1, 3 ); %[output:9f29a704]
%%
%[text] %[text:anchor:H_30816AD4] ## Deselect the line.
deselect( LSC ) %[output:95c8b155]
%%
